    // border: "1px solid black",/
    // backgroundColor: "blue",
    display: "grid",
    gridTemplateRows: "35% 20% 25% 10% ",
    zIndex: "-10",
  };
  const renderedItems = items.map((items) => {
    return <InnerBox items={items} />;
  });
  if (items.length === 4) {
    return <div style={boxStyleComponent}>{renderedItems}</div>;
  }
  if (items.length === 1) {
    console.log("yesss");
  }
};
export default Box;
